import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';

const Contacts = () => {
	return (
		<div>
			<h2>Контакты</h2>
			<div>
				<ul>
					<NavLink to="/dialogs/1"><li>Иван Лох</li></NavLink>
					<NavLink to="/dialogs/2"><li>Сергей Петух</li></NavLink>
					<NavLink to="/dialogs/3"><li>Анальный Зонд</li></NavLink>
					<NavLink to="/dialogs/4"><li>Ректальный Мастер</li></NavLink>
					<NavLink to="/dialogs/5"><li>Сосочный Вибратор</li></NavLink>
				</ul>
			</div>
		</div>
	);
}

export default Contacts;
